import React from 'react'
import Logo from '../imgs/logo.png'
import { Link } from 'react-router-dom';

function Navbar() {
  return (
    <div className='navbar'>
      <div className="container">
      <div className="Logo">
        <img src={Logo} alt="Logo"></img>
      </div>

      <div className="Links">
        <Link> classArt </Link>
      </div>
      </div>
    </div>
  )
}

export default Navbar;
